"""## 4.

![image.png](data:image/png;base64,)

##SOLUO

Para a resoluo dessa questo primeiramente calculamos o logaritmo natural da populao, o que  necessrio para transformar o modelo exponencial em um modelo linear. Aps isso, calculamos as somas necessrias para a criao das equaes normais de regresso linear. Essas somas so usadas para calcular os coeficientes da funo exponencial. Assim,aps isso, o cdigo usa as equaes normais para calcular os coeficientes da funo exponencial.

 Por fim, plotamos o grfico com o ajuste exponencial de minimos quadrados. Portanto, encontramos os seguintes valores:

 - Equao de ajuste exponencial: p(t) = 0.99 * e^(0.60t)
 - Previso de populao aps 5 horas: 19.97 milhares
"""

import numpy as np
import matplotlib.pyplot as plt

# Dados
t = np.array([0, 1, 2, 3, 4])
p = np.array([1.0, 1.8, 3.3, 6.0, 11.0])

# Logaritmo Natural dos Dados
ln_p = np.log(p)

# Clculo das Soma dos Valores para as Equaes
n = len(t)
soma_t = np.sum(t)
soma_ln_p = np.sum(ln_p)
soma_t_ln_p = np.sum(t * ln_p)
soma_t_squared = np.sum(t**2)

# Calculo do coeficiente b e ln (a)
b = (n * soma_t_ln_p - soma_t * soma_ln_p) / (n * soma_t_squared - soma_t**2)
ln_a = (soma_ln_p - b * soma_t) / n
a = np.exp(ln_a)
previsao_populacao = a * np.exp(b * 5)



# Plotar os dados no grfico
plt.scatter(t, p, label='Dados')
t_range = np.linspace(0, 5, 400)
plt.plot(t_range, a * np.exp(b * t_range), color='red', label='Ajuste exponencial')
plt.xlabel('Horrio (horas)')
plt.ylabel('Populaao (milhares)')
plt.legend()
plt.title('Ajuste exponencial de mnimos quadrados')
plt.show()

print(f"Equao de ajuste exponencial: p(t) = {a:.2f} * e^({b:.2f}t)")
print(f"Previso de populao aps 5 horas: {previsao_populacao:.2f} milhares")

